def ref(arr, l, r):
    dp = [1] + [0] * 50000
    mod = 10 ** 9 + 7
    ll = 20003
    maxV = -1
    freq = [0]*ll
    for i in arr:
        freq[i] += 1
        if maxV < i:
            maxV = i
    counter = []
    for i in range(1, maxV+1):
        if freq[i] > 0:
            counter.append((i, freq[i]))
    for a,c in counter:
        for i in range(r, max(r - a, 0), -1):
            v = sum(dp[i - a * k] for k in range(c))
            for j in range(i, 0, -a):
                v -= dp[j] - dp[j - a * c]
                dp[j] = (dp[j] + v) % mod
            print(a, c)
    return (freq[0] + 1) * sum(dp[l:r + 1]) % mod


def solve(arr, l, r):
    mod = 10**9 + 7
    ll = 20003
    maxV = -1
    freq = [0]*ll
    for i in arr:
        freq[i] += 1
        if maxV < i:
            maxV = i
    a = []
    for i in range(1, maxV+1):
        if freq[i] > 0:
            a.append((i, freq[i]))
    dp = [0]*(r+1)
    ndp = [0]*(r+1)
    for i in range(len(a)):
        val, f = a[i]
        for wi in range(max(0, r-val+1), r+1):
            for j in range(1, f+1):
                if wi-val*j > 0:
                    ndp[wi] = (ndp[wi]%mod + dp[wi - val*j]%mod)%mod
                if wi == val*j:
                    ndp[wi] = (ndp[wi]%mod + 1)%mod
            y = wi-val
            yy = wi-val*(f+1)
            t = ndp[wi]
            if dp[wi] > 0:
                t = (t%mod - dp[wi]%mod + mod)%mod
            w = wi - val
            while w >= val:
                t = (t%mod - dp[y]%mod + mod)%mod
                if yy >= 1:
                    t = (t%mod + dp[yy]%mod)%mod
                elif yy == 0:
                    t = (t%mod + 1)%mod
                # print("wwww", w, dp[w], t)
                ndp[w] = (dp[w]%mod + t%mod)%mod
                w -= val
                y -= val
                yy -= val
            
        for w in range(1, r+1):
            dp[w] = ndp[w]
        # print(i, a[i], dp)
    ans = 0
    for i in range(l, r+1):
        if i > 0:
            ans = (ans%mod + dp[i]%mod)%mod
            ans = (ans%mod + (dp[i]%mod * freq[0]%mod)%mod )%mod
        else:
            ans = (ans%mod + (freq[i]+1)%mod)%mod
    return ans

